static int
format_decoder (const xtensa_insnbuf insn)
{
  if ((insn[0] & 0x8) == 0 && (insn[1] & 0) == 0)
    return 0; /* x24 */
  if ((insn[0] & 0xc) == 0x8 && (insn[1] & 0) == 0)
    return 1; /* x16a */
  if ((insn[0] & 0xe) == 0xc && (insn[1] & 0) == 0)
    return 2; /* x16b */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0) == 0)
    return 3; /* F0 */
  if ((insn[0] & 0x1f) == 0xf && (insn[1] & 0) == 0)
    return 4; /* F1 */
  if ((insn[0] & 0x3f) == 0x1f && (insn[1] & 0) == 0)
    return 5; /* F2 */
  if ((insn[0] & 0x7f) == 0x3f && (insn[1] & 0) == 0)
    return 6; /* F3 */
  return -1;
}

